import React, { Component } from "react";

//Styled Components
import { PostContainer } from "../../styled/posts/postContainer";
import { Post } from "../../styled/posts/post";
import { PostInfo } from "../../styled/posts/postInfo";
 
export default class Feed extends Component {
  render() {
    return (
      <div>

    <PostContainer>
        <Post>
            <PostInfo>
                <p>User1 posted</p>
            </PostInfo>
            
            <div className="postTitle">
                <p>Top 5 Post-Title</p>
            </div>

            <div className="fiveList">
                <ol>
                    <li>Platz 1</li>
                    <li>Platz 2</li>
                    <li>Platz 3</li>
                    <li>Platz 4</li>
                    <li>Platz 5</li>
                </ol>
            </div>

            <div className="socialBar">
                    <div className="hashtagCloud">
                     <p>#Hashtags</p>
                    </div>

                     <div className="interactButtons">
                    <p>Buttons</p>
                    </div>
            </div>

        </Post>


    </PostContainer>


      </div>
    );
  }
}
